[{"location":"","page":"Home","title":"Home","text":"CurrentModule = RdJUFiles","category":"page"},{"location":"#RdJUFiles","page":"Home","title":"RdJUFiles","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"JU410で記録した win formatのファイルを読む関数","category":"page"},{"location":"#rdwin1_ch","page":"Home","title":"rdwin1_ch","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"rdwin1_ch(data; nch=3)\nwin format のファイルを読み込んだデータから波形などの情報を取り出す．\ndata: win format のファイル１つをバイナリで読み込んだデータ\nnch: チャンネル数．ファイルを読めばチャンネル数も決まるが，たとえば，６チャンネル記録する設定になっているが，３チャンネル分しかデータとして記録されていないというような場合に対応するため，引数としている．初期設定は，nch = 3 である．\nrdjusngl，rdjumultから引いており，普通は使用しない．波形のリストを作成するときなどに使用する．","category":"page"},{"location":"#rdjusngl","page":"Home","title":"rdjusngl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"rdjusngl(wvdir, obs ; coef=1.2310680e-07, rm_offset=1)\nイメージとしては，単点測定．\nwvdir：文字型変数：測定点の上のディレクトリの名前\nobs：文字型ベクトル：複数の測定の名前","category":"page"},{"location":"#rdjumult","page":"Home","title":"rdjumult","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"rdjumult(wvdir, obs, pnt; coef=1.2310680e-07, rm_offset=1)\nイメージとしては，アレイ測定のように１測定で複数のセンサーを設置している場合．\nwvdir：文字型変数：測定点の上のディレクトリの名前\nobs：文字型ベクトル：複数の測定の名前\npnt：文字型ベクトル：複数のセンサーの名前","category":"page"},{"location":"#共通事項","page":"Home","title":"共通事項","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"オプション\ncoef=1.2310680e-07：地動換算係数をゲイン ×100 のときの値を初期設定としている．\nrm_offset=1：オフセットを除いた波形を返す．\n返す値：named tupleで返している．\nwave = rdju( ) のように返した場合\nwave.headtime：先頭時刻を配列で返す．［年，月，日，時，分，秒］\nwave.nwave：波形のサンプル数/チャンネル\nwave.hz：サンプリング周波数\nwave.nch：チャンネル数\nwave.chid：チャンネルID．ju410で設定している値．文字型ベクトル\nwave.waveF：波形データ：実数型配列．大きさは (nwave，nch)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Documentation for RdJUFiles.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [RdJUFiles]","category":"page"}]
